package main

import (
	"fmt"
	"strings"
	"time"
	"unicode"
)

func _log(a ...interface{}) {
	fmt.Println(a...)
}

// alternative
func part1_alt(s string) int {
	l := 0
	for l != len(s) {
		l = len(s)
		for r := 'a'; r <= 'z'; r++ {
			R := unicode.ToUpper(r)
			s = strings.Replace(s, string([]rune{r, R}), "", -1)
			s = strings.Replace(s, string([]rune{R, r}), "", -1)
		}
	}
	return l
}

func part1(s string) int {
	sr := []rune(s)
	l := 0
	for l != len(sr) {
		l = len(sr)
		for i := 1; i < len(sr); i++ {
			if sr[i] != sr[i-1] && unicode.ToLower(sr[i]) == unicode.ToLower(sr[i-1]) {
				sr = append(sr[:i-1], sr[i+1:]...)
			}
		}
	}
	return l
}

func part2(s string) int {
	min := len(s)
	for r := 'a'; r <= 'z'; r++ {
		s2 := strings.Replace(s, string(r), "", -1)
		s2 = strings.Replace(s2, string(unicode.ToUpper(r)), "", -1)
		l := part1(s2)
		if min > l {
			min = l
		}
	}
	return min
}

func main() {
	for i, in := range ins {
		fmt.Println("=== for", i, "===")
		t0 := time.Now()
		fmt.Println("part 1:", part1(in))
		t1 := time.Now()
		fmt.Println(t1.Sub(t0))
		fmt.Println("part 2:", part2(in))
		t2 := time.Now()
		fmt.Println(t2.Sub(t1))
		fmt.Println()
	}
}

var ins = map[string]string{
	"github": ``,
	"google": ``}
